import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App, Table, TextForm} from './App';
import * as serviceWorker from './serviceWorker';
ReactDOM.render(<App />, document.getElementById('root'));

var div = document.getElementById("current");
div.id = "current";
if (<App/>.state.page == 0){
  ReactDOM.render(<TextForm />, document.getElementById("current"));
} else {
  ReactDOM.render(<Table />, document.getElementById("current"));
}



